import './App.css';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import { NavigationBar } from './components/NavigationBar';
import { Home } from './Home';
import { About } from './About';
import { NoMatch } from './NoMatch';
import Sidebar from './components/Sidebar';
import Sidemenu from './components/Sidemenu';
const workflow = () => <div>You're on the Profile Tab</div>;
const timeline = () => <div>You're on the Profile Tab</div>;
const packs = () => <div>You're on the Profile Tab</div>;
const designs = () => <div>You're on the Profile Tab</div>;
const trackers = () => <div>You're on the Profile Tab</div>;

function App() {
  return (
      <React.Fragment>
      <Router>
        <Sidebar />
        <Switch>
          <Route exact path="home/workflow" component={workflow} />
          <Route path="/timelines" component={timeline} />
          <Route path="/timelines" component={packs} />
          <Route path="/timelines" component={workflow} />
          <Route path="/timelines" component={workflow} />
        </Switch>
        <Sidemenu />
        <Switch>
          <Route exact path="/home" component={Home} />
          <Route path="/about" component={About} />
          <Route path="/nomatch"component={NoMatch} />
        </Switch>
      </Router>
      </React.Fragment>
  );
}

export default App;
